import './App.css';
import { Navbar } from './components/navbar/Navbar';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import { Shop } from "./pages/Shop";
import {ShopCategory} from  "./pages/ShopCategory"
import { Product } from "./pages/Product";
import {Cart} from "./pages/Cart"
import {LoginSignup} from "./pages/LoginSignup"
import men_banner from '../src/components/assets/banner_mens.png'
import women_banner from '../src/components/assets/banner_women.png'
import kid_banner from './components/assets/banner_kids.png'

function App() {
  return (
    <div>
    <BrowserRouter>
    <Navbar/>

     <Routes>

     <Route path='/' element={<Shop/>}></Route>
     <Route path='/mens' element={<ShopCategory bannercategory ="men"/>}></Route>
     <Route path='/womens' element={<ShopCategory category="women"/>}></Route>
     <Route path='/kids' element={<ShopCategory category="kid"/>}></Route>

     <Route path='/product' element={<Product/>}>
     <Route path='/productId' element={<Product/>} />
     </Route>
     <Route path='/cart' element={<Cart/>} />
     <Route path='/login' element={<LoginSignup/>} />

     </Routes>

    </BrowserRouter>
    </div>
  );
}

export default App;
